import React from 'react'

export default function Footer() {
    return (
        <>
            <br />
            <footer className="credits">
                Built by <a className="credits" href="https://github.com/sylwiavargas">@sylwiavargas</a> and <a className="credits" href="https://github.com/sruti">@sruti</a>
                <br></br> Contact Dr. Nanda: <a className="credits" href="mailto:..edu">tn2290@cumc.columbia.edu</a>
            </footer>
        </>
    )
}
